import React,{Component} from "react"
import { waitForElement } from "@testing-library/react"
import NavBar from "./navbar.js"
import Axios from "axios"
class Profile extends Component{
    
    state={
        user:[],
        profilenumber: 11,
    }




    componentDidMount(){
            fetch(`http://localhost:4000/profile/${this.state.profilenumber}`)
            .then(response => response.json())
            .then(data=>{
                this.setState({
                    user: data
                })
                console.log(data)
            })
    }

    // getuserId(uId){
    //     this.setState({profilenumber:uId})

    // }
    
    
    render(){
        return(
            
            <div>
                <NavBar/>
                <form>
                <input> enter soemthing</input>
                </form>    
                    <ul style={{listStyleType:"none"}}>
                    {this.state.user.map(element => {

                        return(
                           <div> 
                        <li key={element.user_id}>Name {element.fullname}</li> 
                        <li > Contact {element.contact}</li>
                        </div>
                        )
                    })}
                    </ul>
            </div>
        )
    }
}


export default Profile
